[{"location":"","page":"Home","title":"Home","text":"CurrentModule = MultiDimDictionaries","category":"page"},{"location":"#MultiDimDictionaries","page":"Home","title":"MultiDimDictionaries","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Documentation for MultiDimDictionaries.","category":"page"},{"location":"","page":"Home","title":"Home","text":"","category":"page"},{"location":"","page":"Home","title":"Home","text":"Modules = [MultiDimDictionaries]","category":"page"},{"location":"#MultiDimDictionaries._shift_key","page":"Home","title":"MultiDimDictionaries._shift_key","text":"_shift_key(key::Tuple, dims::Tuple, dim::Int, dim_key=1)\n\nEither shift the key in dimension dim by dims[d], or if dim > length(key) then extend the key to length dim by padding with 1s and insert dim_key at dimension dim.\n\nFor example:\n\nf = x -> x + 3\n\nshiftkey(Tuple(2, 2, 2), [3, 3, 3], 2) -> Tuple(2, 5, 2)\n\nshiftkey(Tuple(2, 2, 2), [3, 3, 3], 3) -> Tuple(2, 2, 5)\n\nshiftkey(Tuple(2, 2, 2), [3, 3, 3], 4) -> Tuple(2, 2, 2, 1)\n\nshiftkey(Tuple(2, 2, 2), [3, 3, 3], 4, \"X\") -> Tuple(2, 2, 2, \"X\")\n\nshiftkey(Tuple(2, 2, 2), [3, 3, 3], 0) -> Tuple(1, 2, 5, 2)\n\nshiftkey(Tuple(2, 2, 2), [3, 3, 3], 0, \"X\") -> Tuple(\"X\", 2, 5, 2)\n\nThis is an \"injection\": https://en.wikipedia.org/wiki/Disjoint_union\n\n\n\n\n\n","category":"function"}]
